import { Typography, Box, styled } from '@mui/material';
import React from 'react';

const NoMails = ({ message }) => {
  return (
    <Box>
      <Typography>{message.heading}</Typography>
      <Typography>{message.subHeading}</Typography>
      <Divider />
    </Box>
  );
};

export default NoMails;
